import './App.css';
import '@aws-amplify/ui-react/styles.css';
import { Amplify } from 'aws-amplify';
import awsExports from './aws-exports';
import { Authenticator } from '@aws-amplify/ui-react';
import '@aws-amplify/ui-react/styles.css';
import React from "react";



Amplify.configure(awsExports);
function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/*Authentication*/}
        <Authenticator>
        {({ signOut, user }) => (
          <div className="home-page">
          <div className="div">
            <div className="group">
              <div className="div-2">
                <img className="img" alt="Vaccines black" src="../icon/vaccines-black-24dp-1.svg" />
              </div>
              <div className="text-wrapper">Medication</div>
            </div>
            <div className="overlap">
              <img className="img-2" alt="Person black" src="/icon/person-black-24dp-1.svg" />
            </div>
            <div className="overlap-group">
              <div className="div-2" />
              <img className="img" alt="Edit calendar black" src="/icon/edit-calendar-black-24dp-1.svg" />
            </div>
            <div className="text-wrapper-2">Home Caregiver</div>
            <div className="text-wrapper-3">Bookings</div>
            <div className="question-answer-wrapper">
              <img className="question-answer" alt="Question answer" src="/icon/question-answer-black-24dp-1.svg" />
            </div>
            <div className="text-wrapper-4">Chat</div>
            <h1 className="h-1">Hi, Cindy!</h1>
            <p className="what-would-you-like">
              What would you like <br />
              to do today?
            </p>
            <div className="group-2">
              <div className="div-2">
                <img className="img-2" alt="Celebration black" src="/icon/celebration-black-24dp-1.svg" />
              </div>
              <div className="text-wrapper-5">Events</div>
            </div>
          </div>
        </div>
          // <main>


          //   <button onClick={signOut}>Sign out</button>
          // </main>
        )}
      </Authenticator>
          </header>
    </div>
  );
}

export default App;
